import {createBottomTabNavigator} from "@react-navigation/bottom-tabs";
import {Button, FlatList, StyleSheet, Text, View} from "react-native";
import {NavigationContainer} from "@react-navigation/native";
import axios from "axios";
import {useEffect, useState} from "react";


const Tab = createBottomTabNavigator();

const Home = () => {

    const [members, setMembers] = useState(null);

    useEffect(()=>{
        axios.get("http://localhost:8080/members")
            .then(result => setMembers(result.data))
            .catch(err => console.log(err));
    },[])

    return (
        <FlatList data={members}
                  keyExtractor={(item) => item.id.toString()}
                  renderItem={({item}) =>
                      <Text>{item.name}</Text>}/>

    );
};

const Life = () => {
  return (
      <View>
        <Text>동네 생활 페이지</Text>
      </View>
  );
};

const ItemRegisterPage = () =>{
  return (
      <View>
          <Text>제목</Text>

        <Button title="Create Item" onPress={()=>{
            axios.post("http://localhost:8080/items/new",{
                name : "testUser",
                age : 3,
            }).then(()=>{
                console.log("success");
            }).catch((error) => console.log(error));
        }}/>
      </View>
  );
};

const MyPage = () =>{
  return (
      <View>
        <Text>My page</Text>
      </View>
  );
};

const MyTabs = () =>{

  return (
      <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="홈" component={Home}/>
        <Tab.Screen name="동네생활" component={Life}/>
        <Tab.Screen name="아이템 등록 페이지" component={ItemRegisterPage}/>
        <Tab.Screen name="나의 당근이지" component={MyPage}/>
      </Tab.Navigator>
      </NavigationContainer>
  );
};

const styles = StyleSheet.create({
  container:{
    flex:1,
    backgroundColor:"#708090"
  }
})

export default MyTabs;
